tables.table_schema:
CREATE TABLE call_detail_records (
    record_id UUID PRIMARY KEY,
    phone_number VARCHAR,
    call_duration INTERVAL,
    call_quality_rating INT
);

CREATE TABLE network_providers (
    provider_id UUID PRIMARY KEY,
    provider_name VARCHAR,
    provider_type VARCHAR
);

CREATE TABLE network_performance (
    performance_id UUID PRIMARY KEY,
    provider_id UUID,
    download_speed INT,
    upload_speed INT
);

CREATE TABLE user_devices (
    id UUID PRIMARY KEY,
    user_id UUID,
    device_name VARCHAR,
    os_version VARCHAR
);

CREATE TABLE coverage_area (
    id UUID PRIMARY KEY,
    area_name VARCHAR,
    signal_strength INT,
    connected_users INT
);

CREATE TABLE call_records (
    call_id INT PRIMARY KEY,
    call_duration INT,
    call_date TIMESTAMP,
    call_quality VARCHAR(255)
);

CREATE TABLE user_details (
    user_id INT PRIMARY KEY,
    user_name VARCHAR(255),
    user_location VARCHAR(255),
    user_device VARCHAR(255)
);

CREATE TABLE network_statistics (
    stat_id INT PRIMARY KEY,
    download_speed INT,
    upload_speed INT,
    latency INT
);

CREATE TABLE cell_towers (
    tower_id INT PRIMARY KEY,
    location VARCHAR(255),
    coverage_area INT,
    operator VARCHAR(255)
);

CREATE TABLE service_providers (
    provider_id INT PRIMARY KEY,
    provider_name VARCHAR(255),
    provider_type VARCHAR(255)
);
